"
Wow, nice effort. An inline tag or two won't fail a DYK nomination, but if we get something working well, I could add it in with the alert color less striking. My article tag code doesn't notice how many tags there are; it just sees if the tag exists or not. With inline tags, the code should output how many there are, especially since one or two is nothing to worry about. That could be done by replacing the for loop at the end with 
TABfor (var i=0; i < inlinetaglist.length; i++) {
TABTABif (html.innerHTML.indexOf(inlinetaglist[i][0]) != -1) {
TABTABTABint tagIndex = html.innerHTML.indexOf(inlinetaglist[i][1]);
TABTABTABint tags = 0;
TABTABTABwhile (html.innerHTML.indexOf(inlinetaglist[i][0], tagIndex) != -1) {
TABTABTABTABtags++;
TABTABTABTABtagIndex = html.innerHTML.indexOf(inlinetaglist[i][0], tagIndex) + inlinetaglist[i][1].length;
TABTABTAB}
TABTABTABinlinetagsFound += ""Article has "" + tags + "" "" + inlinetagList[i][1] + "" inline tag(s). "";
TABTAB}
TAB}
